window.bookSummaryJSON = "<p>They are everything to me.</p> <p>I love Jaxson, Ezra, Maverick, and Ryder the same and in vastly different ways all at once. It's a love that threatens to consume me. To take over every waking second of my final year...</p> <p>...if only hidden enemies, ancient secret societies, and unsolved murders weren't also competing for my attention.</p> <p>This will be my hardest term yet.</p> <p>Not just for the horror of the present, but for the uncertainty of my future. How can I have a life with my knights when someone is determined that I don't survive my senior year at all?</p> <p>But I will find them. I will expose them.</p> <p>And by the end...only one will be left standing.</p> <p><i>Unmasked</i> is a reverse harem high school bully romance with a sweet tinge of mystery. This is the final book in the series and features language, dark themes, and sexual scenes.</p>"; 
